    <li><a href="#">Designs</a></li>
    <li><a href="#">About</a></li>
    <li><a href="#">Contact</a></li>
  </ul>
  }

  const useStyles = makeStyles(() => ({
      dropdown_box: {
        position: 'absolute',
        'display': 'inline'
      }
    }))

  const classes = useStyles();

return (

<div className="header">
  <div className="logo1nce" onClick={()=> navigate('/')}/>
